def count_vowels(text):
    restriction=["a","e","i","o","u","A","E","I","O","U"]
    vowels=0
    l=len(text)
    for m in range(l):
        for n in range(10):
            if text[m]==restriction[n]:
                vowels=vowels+1
    print(vowels)        
